class Tree
    attr_accessor :children, :value
    def initialize(v)
        @value = v
        @children = []
    end
    
end


def building_island(matrix, memory, position_str, parent_tree = nil)
    x,y = position_str.split(",").map(&:to_i)
    if matrix[x][y] == "1"
        current_position = "#{x},#{y}"

        #Mirar que la posicion no se haya recorrido 
        return parent_tree if memory.include? current_position
        
        new_tree = Tree.new(current_position)
        parent_tree.children << new_tree if parent_tree
        memory << current_position

        # pp memory

        #Visitar los cercanos

        #Vertical 
        up = "#{x - 1},#{y}"
        down = "#{x + 1},#{y}"

        #Horizontal
        right = "#{x},#{y + 1}"
        left = "#{x},#{y - 1}"
        if !(memory.include? up) && matrix[up.split(",").first.to_i] && (matrix[up.split(",").first.to_i][up.split(",").last.to_i] == "1") && (up.split(",").first.to_i >= 0)
            # pp "Entro up: #{up} V:#{matrix[up.split(",").first.to_i][up.split(",").last.to_i]}"

            building_island(matrix, memory, up, new_tree ) 
        end
        if !(memory.include? down) && matrix[down.split(",").first.to_i] && (matrix[down.split(",").first.to_i][down.split(",").last.to_i] == "1")
            # pp "Entro en Down: #{down} V:#{matrix[down.split(",").first.to_i][down.split(",").last.to_i]}"

            building_island(matrix, memory, down, new_tree ) 
        end
        if !(memory.include? right) && matrix[right.split(",").first.to_i] && (matrix[right.split(",").first.to_i][right.split(",").last.to_i] == "1")
            # pp "Entro Right: #{right} V:#{matrix[right.split(",").first.to_i][right.split(",").last.to_i]}"

            building_island(matrix, memory, right, new_tree ) 
        end
        if !(memory.include? left) && matrix[left.split(",").first.to_i] && (matrix[left.split(",").first.to_i][left.split(",").last.to_i] == "1") && (left.split(",").last.to_i >= 0)
            # pp "Entro en left: #{left} V:#{matrix[left.split(",").first.to_i][left.split(",").last.to_i]}"

            building_island(matrix, memory, left, new_tree ) 
        end
        
        # pp "RETORNA #{parent_tree}"
        if parent_tree.nil? 
            return new_tree
        else
            parent_tree
        end
    else
        # pp "RETORNA #{parent_tree}"
        return parent_tree
    end
end

# @param {Character[][]} grid
# @return {Integer}
def num_islands(grid)
    memory = []
    trees = []
    grid.each_with_index do |row, x|
        next if row.uniq.size == 1
        row.each_with_index do |column, y |
            next if y == "0"
            # pp "-"*90
            # pp "Position: #{x},#{y}"
            next if memory.include?("#{x},#{y}")
            # pp "Se ejecuta Building"
            # puts "MEMORIA AL EMPEZAR #{x}, #{y}: #{memory}"
            result =  building_island(grid, memory,"#{x},#{y}")
            # puts "MEMORIA AL TERMINAR #{x}, #{y}: #{memory}"
            if result
                trees << result
                # pp "SE GUARDA UN TREE Contador: #{trees.count}"
            end
        end
    end

    # pp "RESULTADO: #{trees.count}"
    trees.count

end

